import React from 'react';
import './App.css';
import ChooseBlock from './components/ChooseBlock.js';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      to_do_list: [],
      complete_list: []
    };
    this.handleUpdateToDoList = this.handleUpdateToDoList.bind(this);
  }

  handleUpdateToDoList(e) {
    console.log(e);
  }

  render() {
    return (
      <div className="App">
        <ChooseBlock onUpdateToDoList={this.handleUpdateToDoList} />
      </div>
    )
  }
}

export default App;
